import { Button, TextField } from "@mui/material";
import React, { useState } from "react";

const ChannelsPage = () => {
  const [message, setMessage] = useState("");
  return (
    <div>
      <h1>Page des chats</h1>
      <TextField
        id="message"
        label="Enter message"
        size="normal"
        variant="filled"
        //fullWidth
        margin="normal"
        value={message}
        onChange={(e) => setMessage(e.target.value)}
      />
      <Button
        variant="contained"
        margin="normal"
        onClick={() => SendMessage()}
        color="success"
      >
        Envoyer le message
      </Button>
    </div>
  );
};

export default ChannelsPage;
